import React from 'react'
import "./Header.css"
import punkLogo from '../assets/header/cryptopunk-logo.png'

function Header() {
    return (
        <div className="header">
            <div className="logoContainer">
                <img src={punkLogo} className="punkLogo" alt=""/>
            </div>
        </div>
    )
}

export default Header
